import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import Header from './Containers/Header';
import ProductListing from './Containers/ProductListing';

function App() {
  return (
    <>
    <BrowserRouter>
    <Header />

    <Routes>
      <Route to ='/' Component={ProductListing} />
    </Routes>
    </BrowserRouter>
    </>
  );
}

export default App;
